pragma solidity ^0.8.20;

contract StorageBug {
    uint256[] public importantNumbers;

    constructor() {
        importantNumbers.push(10);
        importantNumbers.push(20);
        importantNumbers.push(35);
    }

    function copyAndModify() public {
        // Explicit storage → memory copy
        uint256[] memory numbers = importantNumbers;

        // Modify memory
        numbers[1] = 999;

        // ❗ No write-back to storage
    }

    function get(uint256 i) external view returns (uint256) {
        return importantNumbers[i];
    }
}

